import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


import { BrowserRouter} from 'react-router-dom'
import Adddata from './Adddata';
ReactDOM.render(
  <BrowserRouter>
   <App />
   <Adddata/>
   </BrowserRouter>,
  document.getElementById('root')
);
